import React from 'react';
import { Link } from 'react-router-dom';
import './MyTrip.css';
import Header from '../../components/Header/Header';
import Trip from '../../components/Trip/TripPreview';
import {ReactComponent as PencilIcon} from '../../assets/Pencil_icon.svg';

export default function MyTrip() {
  return (
    <div className="my-trip">
        <Header/>
        <div className="my-trip__header">
          <h2 className="my-trip__title">My trip</h2>
          <Link to="/edit-trip" className="my-trip__button--edit-trip button-grey"><PencilIcon /></Link>
        </div>
        <div className="my-trip__items">
          {/* trip items, change to dynamic */}
          <Trip />
        </div>
      </div>
  )
}
